tables.table_schema:
CREATE TABLE photo_history (
    id UUID PRIMARY KEY,
    image_id UUID NOT NULL,
    editor_id UUID NOT NULL,
    change_detail TEXT,
    timestamp TIMESTAMP
);

CREATE TABLE editor_details (
    id UUID PRIMARY KEY,
    name VARCHAR(255) NOT NULL,
    email VARCHAR(255) NOT NULL
);

CREATE TABLE editors (
    editor_id SERIAL PRIMARY KEY,
    editor_name TEXT NOT NULL,
    editor_email TEXT
);

CREATE TABLE editors (
    editor_id INT PRIMARY KEY,
    editor_name TEXT,
    editor_email TEXT
);

CREATE TABLE image_metadata (
    image_id INT PRIMARY KEY,
    resolution TEXT,
    format TEXT
);

CREATE TABLE Images (
    image_id INT PRIMARY KEY,
    image_name VARCHAR(100),
    image_path VARCHAR(200)
);

CREATE TABLE Changes (
    change_id INT PRIMARY KEY,
    change_description TEXT,
    change_timestamp TIMESTAMP,
    editor_id INT
);

CREATE TABLE Editors (
    editor_id INT PRIMARY KEY,
    editor_name VARCHAR(100),
    email VARCHAR(200)
);

CREATE TABLE EditorHistory (
    history_id INT PRIMARY KEY,
    editor_id INT,
    action_performed VARCHAR(200),
    timestamp TIMESTAMP
);
